import React from 'react';



interface PlayerPositionProps {

  player: {

    id: string;

    name: string;

    top: string;

    left: string;

  };

  onClick: () => void;

}



const PlayerPosition: React.FC<PlayerPositionProps> = ({ player, onClick }) => {

  return (

    <div

      className="player"

      style={{ top: player.top, left: player.left }}

      onClick={onClick}

    >

      {player.name}

    </div>

  );

};



export default PlayerPosition;
